import React ,{ Component } from 'react';
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import {
Container,
} from 'react-bootstrap'
import Row from 'react-bootstrap/Row'
import './UserHome.css'


class BidsToBuy extends Component {
    constructor(props) {
        super(props);
        this.state = {
        data: null,
        };
    }

    componentDidMount() {
        fetch('http://localhost:9000/recentCrops')
        .then(response => response.json())
        .then(data => this.setState({ data }));
    }

    render(){
        return (
            <div class = "recentbids">
                <Container>
                    <Row>
                        {this.state.data}
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 1
                         <button type="submit" className="btn btn-success btn-block" onClick={this.handleSubmit}>Bid</button>

                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 2
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 3
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 4
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 5
                    </Row>

                </Container>
            </div>
        );
    }
}

export default BidsToBuy;
